import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Header from './components/header/Header';
import Login from './components/login/Login';
import SignIn from './components/signIn/SignIn';
import SignInCheck from './components/signInCheck/SignInCheck';
import ChangePw from './components/changePw/ChangePw';
import PwChangeCheck from './components/pwChagneCheck/PwCheck';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Header/>}/>
        <Route path="/login" element={<Login/>}/>
        <Route path="/signIn" element={<SignIn/>}/>
        <Route path='/signInCheck'element={<SignInCheck/>}/>
        <Route path='/changePw' element={<ChangePw/>}/>
        <Route path='/pwChagneCheck' element={<PwChangeCheck/>}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
